import React from 'react';
import GoogleMapReact from 'google-map-react';

const Marker = props => {
    return <>
      <div className="pin"></div>
      <div className="pulse"></div>
    </>
}

class MapOutput extends React.Component {

    render() { 

        return (

            <>

                <div className="w-full h-[350px]">
                    <GoogleMapReact
                        bootstrapURLKeys={{ key: window.ogSettings.og_gmaps_api_key }}
                        defaultCenter={{ lat: Number(this.props.latitude), lng: Number(this.props.longitude) }}
                        defaultZoom={17}
                    >
                        <Marker lat={Number(this.props.latitude)} lng={ Number(this.props.longitude) } text="My Marker" />
                    </GoogleMapReact>
                </div>

            </>
        )

    }

}

export { MapOutput, Marker };
